import "./Character.css";
import characters from '../db/Character/Character';

function List(props) {
  return <div className='props'>
      <img src={ props.img } alt='cha_image' className='img'/>
        <div className="wrap">
        <span><h4>{ props.id }  { props.name }</h4> <span className="">{ props.nickname }</span></span> 
          
        </div>
    </div>
  ;
}

function Character() {

  return (
    <>
      <h2>List of Characters</h2>
      <ul>
        <characters />
        {characters.map((i) => 
        <List 
        key={i.char_id} 
        id={i.char_id}
        name={i.name}
        birthday={i.birthday}
        occupation={i.occupation}
        img={i.img}
        status={i.status}
        appearance={i.appearance}
        nickname={i.nickname}
        portrayed={i.portrayed}
        better_call_saul_appearance={i.better_call_saul_appearance}

         />)}
      </ul>
    </>
  );
}
export default Character;
